    false,nt"url": null,nt"notes": "This data set consists of estimates of
    mean values of sea-ice thickness and sea-ice draft in meters computed from three
    different input data sets: sea ice draft from Upward Looking Sonar (ULS) mounted
    on submarines, sea ice draft from ULS mounted on bottom-anchored moorings, and a
    simulated ice-thickness model. The data span from 1979 to 2004 and cover two regions
    centered around the North Pole. One region, Region A, is north of 89 degrees N;
    and the other, Region B, is north of 87 degrees N. The data set consists of one
    ASCII text file. The data are available via FTP.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
